// Constants for ACC: Analog Comparator Controller
const (
	// ACC_CR: Control Register
	// Position of SWRST field.
	ACC_ACC_CR_SWRST_Pos = 0x0
	// Bit mask of SWRST field.
	ACC_ACC_CR_SWRST_Msk = 0x1
	// Bit SWRST.
	ACC_ACC_CR_SWRST = 0x1

	// ACC_MR: Mode Register
	// Position of SELMINUS field.
	ACC_ACC_MR_SELMINUS_Pos = 0x0
	// Bit mask of SELMINUS field.
	ACC_ACC_MR_SELMINUS_Msk = 0x7
	// Select TS
	ACC_ACC_MR_SELMINUS_TS = 0x0
	// Select VREFP
	ACC_ACC_MR_SELMINUS_VREFP = 0x1
	// Select DAC0
	ACC_ACC_MR_SELMINUS_DAC0 = 0x2
	// Select DAC1
	ACC_ACC_MR_SELMINUS_DAC1 = 0x3
	// Select AFE0_AD0
	ACC_ACC_MR_SELMINUS_AFE0_AD0 = 0x4
	// Select AFE0_AD1
	ACC_ACC_MR_SELMINUS_AFE0_AD1 = 0x5
	// Select AFE0_AD2
	ACC_ACC_MR_SELMINUS_AFE0_AD2 = 0x6
	// Select AFE0_AD3
	ACC_ACC_MR_SELMINUS_AFE0_AD3 = 0x7
	// Position of SELPLUS field.
	ACC_ACC_MR_SELPLUS_Pos = 0x4
	// Bit mask of SELPLUS field.
	ACC_ACC_MR_SELPLUS_Msk = 0x70
	// Select AFE0_AD0
	ACC_ACC_MR_SELPLUS_AFE0_AD0 = 0x0
	// Select AFE0_AD1
	ACC_ACC_MR_SELPLUS_AFE0_AD1 = 0x1
	// Select AFE0_AD2
	ACC_ACC_MR_SELPLUS_AFE0_AD2 = 0x2
	// Select AFE0_AD3
	ACC_ACC_MR_SELPLUS_AFE0_AD3 = 0x3
	// Select AFE0_AD4
	ACC_ACC_MR_SELPLUS_AFE0_AD4 = 0x4
	// Select AFE0_AD5
	ACC_ACC_MR_SELPLUS_AFE0_AD5 = 0x5
	// Select AFE1_AD0
	ACC_ACC_MR_SELPLUS_AFE1_AD0 = 0x6
	// Select AFE1_AD1
	ACC_ACC_MR_SELPLUS_AFE1_AD1 = 0x7
	// Position of ACEN field.
	ACC_ACC_MR_ACEN_Pos = 0x8
	// Bit mask of ACEN field.
	ACC_ACC_MR_ACEN_Msk = 0x100
	// Bit ACEN.
	ACC_ACC_MR_ACEN = 0x100
	// Analog comparator disabled.
	ACC_ACC_MR_ACEN_DIS = 0x0
	// Analog comparator enabled.
	ACC_ACC_MR_ACEN_EN = 0x1
	// Position of EDGETYP field.
	ACC_ACC_MR_EDGETYP_Pos = 0x9
	// Bit mask of EDGETYP field.
	ACC_ACC_MR_EDGETYP_Msk = 0x600
	// Only rising edge of comparator output
	ACC_ACC_MR_EDGETYP_RISING = 0x0
	// Falling edge of comparator output
	ACC_ACC_MR_EDGETYP_FALLING = 0x1
	// Any edge of comparator output
	ACC_ACC_MR_EDGETYP_ANY = 0x2
	// Position of INV field.
	ACC_ACC_MR_INV_Pos = 0xc
	// Bit mask of INV field.
	ACC_ACC_MR_INV_Msk = 0x1000
	// Bit INV.
	ACC_ACC_MR_INV = 0x1000
	// Analog comparator output is directly processed.
	ACC_ACC_MR_INV_DIS = 0x0
	// Analog comparator output is inverted prior to being processed.
	ACC_ACC_MR_INV_EN = 0x1
	// Position of SELFS field.
	ACC_ACC_MR_SELFS_Pos = 0xd
	// Bit mask of SELFS field.
	ACC_ACC_MR_SELFS_Msk = 0x2000
	// Bit SELFS.
	ACC_ACC_MR_SELFS = 0x2000
	// The CE flag is used to drive the FAULT output.
	ACC_ACC_MR_SELFS_CE = 0x0
	// The output of the analog comparator flag is used to drive the FAULT output.
	ACC_ACC_MR_SELFS_OUTPUT = 0x1
	// Position of FE field.
	ACC_ACC_MR_FE_Pos = 0xe
	// Bit mask of FE field.
	ACC_ACC_MR_FE_Msk = 0x4000
	// Bit FE.
	ACC_ACC_MR_FE = 0x4000
	// The FAULT output is tied to 0.
	ACC_ACC_MR_FE_DIS = 0x0
	// The FAULT output is driven by the signal defined by SELFS.
	ACC_ACC_MR_FE_EN = 0x1

	// ACC_IER: Interrupt Enable Register
	// Position of CE field.
	ACC_ACC_IER_CE_Pos = 0x0
	// Bit mask of CE field.
	ACC_ACC_IER_CE_Msk = 0x1
	// Bit CE.
	ACC_ACC_IER_CE = 0x1

	// ACC_IDR: Interrupt Disable Register
	// Position of CE field.
	ACC_ACC_IDR_CE_Pos = 0x0
	// Bit mask of CE field.
	ACC_ACC_IDR_CE_Msk = 0x1
	// Bit CE.
	ACC_ACC_IDR_CE = 0x1

	// ACC_IMR: Interrupt Mask Register
	// Position of CE field.
	ACC_ACC_IMR_CE_Pos = 0x0
	// Bit mask of CE field.
	ACC_ACC_IMR_CE_Msk = 0x1
	// Bit CE.
	ACC_ACC_IMR_CE = 0x1

	// ACC_ISR: Interrupt Status Register
	// Position of CE field.
	ACC_ACC_ISR_CE_Pos = 0x0
	// Bit mask of CE field.
	ACC_ACC_ISR_CE_Msk = 0x1
	// Bit CE.
	ACC_ACC_ISR_CE = 0x1
	// Position of SCO field.
	ACC_ACC_ISR_SCO_Pos = 0x1
	// Bit mask of SCO field.
	ACC_ACC_ISR_SCO_Msk = 0x2
	// Bit SCO.
	ACC_ACC_ISR_SCO = 0x2
	// Position of MASK field.
	ACC_ACC_ISR_MASK_Pos = 0x1f
	// Bit mask of MASK field.
	ACC_ACC_ISR_MASK_Msk = 0x80000000
	// Bit MASK.
	ACC_ACC_ISR_MASK = 0x80000000

	// ACC_ACR: Analog Control Register
	// Position of ISEL field.
	ACC_ACC_ACR_ISEL_Pos = 0x0
	// Bit mask of ISEL field.
	ACC_ACC_ACR_ISEL_Msk = 0x1
	// Bit ISEL.
	ACC_ACC_ACR_ISEL = 0x1
	// Low-power option.
	ACC_ACC_ACR_ISEL_LOPW = 0x0
	// High-speed option.
	ACC_ACC_ACR_ISEL_HISP = 0x1
	// Position of HYST field.
	ACC_ACC_ACR_HYST_Pos = 0x1
	// Bit mask of HYST field.
	ACC_ACC_ACR_HYST_Msk = 0x6

	// ACC_WPMR: Write Protection Mode Register
	// Position of WPEN field.
	ACC_ACC_WPMR_WPEN_Pos = 0x0
	// Bit mask of WPEN field.
	ACC_ACC_WPMR_WPEN_Msk = 0x1
	// Bit WPEN.
	ACC_ACC_WPMR_WPEN = 0x1
	// Position of WPKEY field.
	ACC_ACC_WPMR_WPKEY_Pos = 0x8
	// Bit mask of WPKEY field.
	ACC_ACC_WPMR_WPKEY_Msk = 0xffffff00
	// Writing any other value in this field aborts the write operation of the WPEN bit.Always reads as 0.
	ACC_ACC_WPMR_WPKEY_PASSWD = 0x414343

	// ACC_WPSR: Write Protection Status Register
	// Position of WPVS field.
	ACC_ACC_WPSR_WPVS_Pos = 0x0
	// Bit mask of WPVS field.
	ACC_ACC_WPSR_WPVS_Msk = 0x1
	// Bit WPVS.
	ACC_ACC_WPSR_WPVS = 0x1

	// ACC_VER: Version Register
	// Position of VERSION field.
	ACC_ACC_VER_VERSION_Pos = 0x0
	// Bit mask of VERSION field.
	ACC_ACC_VER_VERSION_Msk = 0xfff
	// Position of MFN field.
	ACC_ACC_VER_MFN_Pos = 0x10
	// Bit mask of MFN field.
	ACC_ACC_VER_MFN_Msk = 0x70000
)

