	SUPC_SUPC_CR_XTALSEL = 0x8
	// No effect.
	SUPC_SUPC_CR_XTALSEL_NO_EFFECT = 0x0
	// If KEY is correct, XTALSEL switches the slow clock on the crystal oscillator output.
	SUPC_SUPC_CR_XTALSEL_CRYSTAL_SEL = 0x1
	// Position of KEY field.
	SUPC_SUPC_CR_KEY_Pos = 0x18
	// Bit mask of KEY field.
	SUPC_SUPC_CR_KEY_Msk = 0xff000000
	// Writing any other value in this field aborts the write operation.
	SUPC_SUPC_CR_KEY_PASSWD = 0xa5

